window.bookSummaryJSON = "<p>“IT’S SHOWTIME.” The news has made headlines-\"Korea and Japan join hands to exterminate the terrifying magic beasts on Jeju Island once and for all!” It’s a monumental moment for the people of the country…and it has absolutely nothing to do with Jinwoo. Instead, the newest S-rank hunter’s number one priority is bringing his recently recovered mother back home where she belongs at last. When the situation on Jeju Island takes a devastating turn for the worse, though, will the country's top hunters be strong enough to save the day without him?</p>"; 
